import "./App.css";
import React from "react";
function App() {
  const name = "ninad";

  let ls = [1, 2, 3, 4, 5, 6];

  let data = ls.map((num) => <h1>{num}</h1>);

  return <div className="App">{data}</div>;
}

export default App;
